import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for search input using placeholder selector (different from previous attempts)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Attempt XSS payload
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for a search button by role and class (different selector)
    await page.waitForSelector('button.search-btn', { timeout: 5000 });

    // Click the first visible search button (multiple exist, so use nth-of-type)
    const searchBtn = await page.$$('button.search-btn');
    if (searchBtn.length > 0) {
      await searchBtn[0].click();
    }

    // Wait for any notification or result area to update (look for .notification or .results-count)
    // Use Promise.race to not hang if neither appears
    await Promise.race([
      page.waitForSelector('.notification', { timeout: 3000 }).catch(() => {}),
      page.waitForSelector('.results-count', { timeout: 3000 }).catch(() => {})
    ]);

    // Take screenshot after search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract any notification text or search result count to verify XSS attempt
    let notificationText = '';
    let resultsCount = '';
    try {
      const notif = await page.$('.notification');
      if (notif) {
        notificationText = await notif.textContent();
      }
    } catch {}
    try {
      const results = await page.$('.results-count');
      if (results) {
        resultsCount = await results.textContent();
      }
    } catch {}

    // Check if XSS payload is reflected in the DOM (dangerous, but just check for presence)
    const pageContent = await page.content();
    const xssReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and triggered search, with screenshots and DOM checks.",
      extractedData: {
        notificationText,
        resultsCount,
        xssPayload,
        xssReflected
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
